import React from "react";

function MiddleContent() {
  return (
    <div>
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
        }}
        className="pt-4"
      >
        <div
          style={{
            width: "50%",
          }}
        >
          <h1
            className=" text-white font-weight-bold"
            style={{
              fontSize: "calc(100% + 1.5vw + 1vh)",
              textAlign: "center",
            }}
          >
            Build your own ecommerce website in 3 easy steps
          </h1>
        </div>

        <div>
          <p
            className="text-white h2"
            style={{
              fontSize: "calc(100% + 0.5vw + 1vh)",
              textAlign: "center",
            }}
          >
            Shopify is trusted by over 1,700,000 businesses worldwide
          </p>
        </div>
      </div>
      <div
        className=" mt-5 row"
        style={{
          width: "95vw",
          display: "flex",
          justifyContent: "center",
        }}
      >
        <input
          className="ml-3 p-4 col-10 mt-3 col-sm-2"
          placeholder="Enter your email address"
          style={{
            width: "24vw",
            padding: 14,
            borderRadius: 3,
            border: "none",
          }}
        />

        <div className="  col-10 col-sm-3">
          <button
            style={{
              backgroundColor: "#212326",
              color: "white",
            }}
            className="btn  ml-3 p-4 mt-3 "
          >
            Start free trial
          </button>
        </div>
      </div>
      <div
        style={{
          text: "center",
          width: "95vw",
          display: "flex",
          justifyContent: "center",
        }}
        className="pt-3"
      >
        <h6 className="text-white ">
          By entering your email, you agree to receive marketing emails from
          Shopify.
        </h6>
      </div>
    </div>
  );
}

export default MiddleContent;

const myStyleSheet = {
  text1: {
    backgroundColor: "red",
  },
};
